// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "./SafeMath32.sol";
import "./SafeMath8.sol";

contract FwarCharStorage {
    using SafeMath for uint256;
    using SafeMath32 for uint32;
    using SafeMath8 for uint8;

    //Character infomation
    struct CharInfo {
        uint8 level;
        uint8 rarity;
        uint8 elementType;
        uint32 teamId;

        uint32 baseAttack;
        uint32 baseDefense;
        uint32 baseHealth;

        uint32 attack;
        uint32 defense;
        uint32 health;
    }

    //Burning information
    struct BurnInfo {
        //amount of Junk card to burn
        uint8 junkAmount;

        //amount of Normal card to burn
        uint8 normalAmount;

        //amount of Rare card to burn
        uint8 rareAmount;

        //amount of same upgrade card rarity to burn
        uint8 baseAmount;

        //percentage bonus on consume NFT
        uint8 percentConsume;

        //percentage bonus on base stat NFT
        uint8 percentOnBase;
    }

    //Team information used to random state of character
    struct TeamInfo{
        uint32 maxRandom;
        uint32 minRandom;
    }

    struct CharStat{
        uint32 maxAttack;
        uint32 minAttack;
        uint32 maxDefense;
        uint32 minDefense;
        uint32 maxHealth;
        uint32 minHealth;
    }

    //TeamCount
    uint32 public TeamCount;

    //TeamInfos
    mapping(uint32 => TeamInfo) public teamInfos;

    //TeamId => rarity => charStat
    mapping(uint32 => mapping(uint8 => CharStat)) public charStats;

    //FWC Address
    address public fwarCharAddress;

    //FWK Address
    address public fwarKeyAddress;

    //Seed Address
    address public seedAddress;


    uint32[] public RARITY_MASK; 
    uint32[] public ELEMENT_MASK;

    uint32 internal  MULTIPLER; //1e3 use for stat of character

    // rarity -> level -> BurnInfo
    mapping(uint => mapping(uint => BurnInfo)) public burnInfos;
}
